    false,nt"url": null,nt"notes": "This metadata describes the digital ortho
    imagery covering Franklin County, FL. This 1"=200' scale imagery is comprised of
    24 bit natural color orthophotography with a GSD (Ground Sample Distance) of 1.0
    foot. Imagery was collected with an UltraCamLp digital imaging sensor and processed
    with Microsoft Ultramap v3 image processing software. Imagery is projected in State
    Plane Coordinate System, Florida North using Lambert Conformal map projection parameters.
    Tiles were cut to pre-determined 5000' x 5000' windows as supplied by the Florida
    DOR.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
